import React from "react";
import { Row, Col } from "react-bootstrap";

import Heading from "../Heading";

function ActivityEvent() {
  return (
    <Row>
      <Col sm={12} className="my-1 mx-auto" id="activityEvent">
        <Heading
          content="Events & Activities"
          design="fw-bold fs-5 bg-info text-white rounded text-center mb-3"
        />
        <Row className="my-3 mx-auto">
          <Col sm={8} className="justify-content-center">
            <div class="ratio ratio-16x9">
              <iframe
                src="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FMYzomin%2Fvideos%2F1192498367864603%2F&show_text=0&width=560"
                allowFullScreen="true"
              ></iframe>
            </div>
          </Col>
        </Row>
      </Col>
    </Row>
  );
}

export default ActivityEvent;
